function detailFaqDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-Faq-detail').modal('show');

				$('#Detail-Faq-Active').prop('checked', data.active);
				$('#Detail-Faq-Answer').val(data.answer);
				$('#Detail-Faq-Questionnaire').val(data.questionnaire);
				$('#Detail-Faq-Section').val(data.section);

}
